text:
@unilever
Speaking about sustainability, recycling, environment and waste-free without mentioning #CANNABIS / #HEMP  is a waste of #TIME besides the waste of money and intelligence! Including #CANHAMO would do a great job for your message on a ad that it’s showing in my page for the fourth time. This #plant is part of not only Americans culture but it includes all people worldwide. 
- just my opinion

